    color: "goldenrod",
    size: 150,
    animate: true,
  };
  console.log(props);
  return (
    <ReactAnimatedWeather
      icon={defaults.icon}
      color={defaults.color}
      size={defaults.size}
      animate={defaults.animate}
    />
  );
}
